import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'

export const Hello = () => {

    const [initialState, setInitialState] = useState([])

    useEffect(() => {
        fetch('/api/').then(res => {
            if (res.ok) {
                return res.json()
            }   
        }).then(jsonResponse => setInitialState(jsonResponse.helo))
    }, [])


    // console.log(initialState);
    return ( <div> {initialState.length > 0 && initialState.map((e) => <h1>{e}</h1>)} </div>
    )

}
